import React from "react";
import { Row, Col, Button, Table, Container } from "react-bootstrap";
import { useSelector } from "react-redux";
import profile from "../components/profile.jpg";
import { Paper } from "@mui/material";
const Worker = () => {
  const worker = useSelector((state) => state.dataw.worker);
  return (
    <>
      <div className="container-picture">
        <Container>
          <Row xs={10} md={4}>
            <Col>
              <img src={profile} className="rounded" alt="Pic"></img>
            </Col>

            <Col xs={8}>
              <Paper style={{ marginTop: "35px" }} elevation={3}>
                <h4>Profile</h4>
                <h6>
                  Name:<span></span> {worker.fName}
                </h6>
                <h6>Email:</h6>
                <h6>Phone Number:</h6>
                <h6>Age:</h6>
              </Paper>
            </Col>
          </Row>
          <Button style={{ marginLeft: "60px" }} variant="info">
            Change Profile Pitcure
          </Button>
        </Container>
      </div>
    </>
  );
};

export default Worker;
